const html = '<h1 id="component-library-rbb-data-svelte-starter" tabindex="-1">Component library: <a href="https://github.com/rbb-data/svelte-starter" target="_blank">rbb-data/svelte-starter</a> <a class="header-anchor" href="#component-library-rbb-data-svelte-starter" aria-hidden="true">#</a></h1>\n<p>This storybook documents the component library that comes with <a href="https://github.com/rbb-data/svelte-starter" target="_blank">rbb-data/svelte-starter</a>, a template project to create data visualizations with <a href="https://svelte.dev/" target="_blank">Svelte</a> and <a href="https://kit.svelte.dev/" target="_blank">SvelteKit</a>.</p>\n<p>Since <a href="https://github.com/rbb-data/svelte-starter" target="_blank">rbb-data/svelte-starter</a> is meant to be templated, the components documented here are usually copy-pasted into a project and thus serve as a starting point for an implementation (rather than a finalized solution).</p>\n<p>Some components implement common UI patterns (folder &quot;User interface&quot;), others help to implement charts and data visualizations (folder &quot;Viz&quot;). The folder &quot;LayerCake&quot; contains building blocks for charts. These are meant to be used with <a href="https://layercake.graphics/" target="_blank">LayerCake</a> and <a href="https://github.com/sophiamersmann/friendly-charts" target="_blank">Friendly Charts</a>. <a href="https://github.com/rbb-data/svelte-starter" target="_blank">rbb-data/svelte-starter</a> comes with few examples on how to use these components: <a href="https://github.com/rbb-data/svelte-starter/tree/main/src/routes/examples" target="_blank">https://github.com/rbb-data/svelte-starter/tree/main/src/routes/examples</a>.</p>\n';
